const SCENE_IMAGES = {};
const _imgData = {
  house: 'data:image/jpeg;base64,',
  port: 'data:image/jpeg;base64,',
  beach: 'data:image/jpeg;base64,',
  town: 'data:image/jpeg;base64,',
  cave: 'data:image/jpeg;base64,',
  church: 'data:image/jpeg;base64,',
  hilltop: 'data:image/jpeg;base64,',
  boat: 'data:image/jpeg;base64,',
  title: 'data:image/jpeg;base64,'
};
Object.keys(_imgData).forEach(k => {
  const img = new Image();
  img.src = _imgData[k];
  SCENE_IMAGES[k] = img;
});
// Set title screen background
SCENE_IMAGES.title.onload = function() {
  document.getElementById('title-screen').style.backgroundImage = 'url(' + _imgData.title + ')';
};
if (SCENE_IMAGES.title.complete) {
  document.getElementById('title-screen').style.backgroundImage = 'url(' + _imgData.title + ')';
}


// --- CHARACTER SPRITES (AI-generated) ---
const CHAR_SPRITES = {};
const WALK_FRAMES = { ntemis: [], ajax: [], clio: [] };
const _spriteData = {
  ntemis: 'data:image/png;base64,',
  ajax: 'data:image/png;base64,',
  clio: 'data:image/png;base64,'
};
Object.keys(_spriteData).forEach(k => {
  const img = new Image();
  img.src = _spriteData[k];
  CHAR_SPRITES[k] = img;
});

const _walkData = {
  ntemis: [
    'data:image/png;base64,',
    'data:image/png;base64,',
    'data:image/png;base64,',
    'data:image/png;base64,'
  ],
  ajax: [
    'data:image/png;base64,',
    'data:image/png;base64,',
    'data:image/png;base64,',
    'data:image/png;base64,'
  ],
  clio: [
    'data:image/png;base64,',
    'data:image/png;base64,',
    'data:image/png;base64,',
    'data:image/png;base64,'
  ],
};
Object.keys(_walkData).forEach(k => {
  WALK_FRAMES[k] = _walkData[k].map(src => {
    const img = new Image();
    img.src = src;
    return img;
  });
});

